import { NgModule } from '@angular/core';
import { RouterModule } from '@angular/router';

@NgModule({
  imports: [
    RouterModule.forChild([
      {
        path: 'overpayment',
        data: { pageTitle: 'nspay2App.payment.overpayment.home.title' },
        loadChildren: () => import('./overpayment/overpayment.module').then(m => m.OverpaymentModule),
      },
      {
        path: 'annual-write-offs',
        data: { pageTitle: 'nspay2App.payment.annualWriteOff.home.title' },
        loadChildren: () => import('./annual-write-off/annual-write-off.module').then(m => m.AnnualWriteOffModule),
      },
      {
        path: 'deduction',
        data: { pageTitle: 'nspay2App.payment.deduction.home.title' },
        loadChildren: () => import('./deduction/deduction.module').then(m => m.DeductionModule),
      },
      {
        path: 'bankfile',
        data: { pageTitle: 'nspay2App.payment.bankfile.home.title', tab: 0},
        loadChildren: () => import('./bankfile-stop-payment/bankfile-stop-payment.module').then(m => m.BankfileStopPaymentModule),
      },
      {
        path: 'stop-payment',
        data: { pageTitle: 'nspay2App.payment.stopPayment.home.title', tab: 1},
        loadChildren: () => import('./bankfile-stop-payment/bankfile-stop-payment.module').then(m => m.BankfileStopPaymentModule),
      },
      {
        path: 'instalment-bankfile',
        data: { pageTitle: 'nspay2App.payment.instalmentBankfile.home.title', tab: 2},
        loadChildren: () => import('./bankfile-stop-payment/bankfile-stop-payment.module').then(m => m.BankfileStopPaymentModule),
      },
      {
        path: 'instalment',
        data: { pageTitle: 'nspay2App.payment.instalment.home.title'},
        loadChildren: () => import('./instalment/instalment.module').then(m => m.InstalmentModule),
      },
      {
        path: 'protected-payable',
        data: { pageTitle: 'nspay2App.payment.protectedPayable.home.title'},
        loadChildren: () => import('./protected-payable/protected-payable.module').then(m => m.ProtectedPayableModule),
      }
    ]),
  ],
})
export class PaymentRoutingModule {}
